import React from 'react';
import {Link} from 'react-router-dom'
import './signup.css'; // Import external CSS file

const SignUp = () => {
  return (
    <div className="signup-container">
      <div className="signup-content">
        <h2 className="fw-bold mb-2 text-uppercase">Sign Up</h2>
        <p className="text-white-50 mb-5">Create your account</p>

        <input className="input-field" type="text" placeholder="Username" />
        <input className="input-field" type="email" placeholder="Email address" />
        <input className="input-field" type="password" placeholder="Password" />
        <input className="input-field" type="text" placeholder="Organization" />

        <button className="signup-btn">Sign Up</button>

        <p className="mb-0">
          Already have an account? <a href="" className="text-white-50 fw-bold"><Link to='/auth/signin'>Login</Link></a>
        </p>
      </div>
    </div>
  );
}

export default SignUp;
